import { Link, Outlet } from "react-router-dom";
import EventsNavigation from "../components/EventsNavigation";

export default function EventsPage() {

    const EVENTS = [
        { id: 'e1', title: 'BMTH_show' },
        { id: 'e2', title: 'RiR_BR' },
        { id: 'e3', title: 'LollaPalooza' },
        { id: 'e4', title: 'Survivors_pilot' },
        { id: 'e5', title: 'Life_is_Good' }
    ];

    return (
        <>
            <EventsNavigation />
            <h1>Events Page</h1>
            <ul>
                {EVENTS.map(({id, title}) => <li key={id}><Link to={title}>{title}</Link></li>)}
            </ul>
            <Outlet />
        </>
    );
}
